const NoMatch = () => {
    return (
        <main>
            <section>
                <header>
                    <h1>404 NOT FOUND</h1>
                </header>
                <hr />
                <img src="https://www.elegantthemes.com/blog/wp-content/uploads/2020/02/000-404.png" alt="Resource Not Found"/>
            </section>
        </main>
    );
};

export default NoMatch;
